import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Home() {
  const navigate = useNavigate();
  const [city, setCity] = useState('');

  const handleSearchClick = () => {
    if (city) {
      navigate(`/hotels/${encodeURIComponent(city)}`);
    } else {
      alert("Please select a city.");
    }
  };

  const handlePlaceClick = (cityName) => {
    navigate(`/hotels/${encodeURIComponent(cityName)}`);
  };

  const pageStyles = `
    body {
      margin: 0;
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
      background-color: #f8f9fa;
    }
    
    .home-container * {
      box-sizing: border-box;
    }

    /* The main hero section with the background image */
    .hero-section {
      /* New background image and increased height */
      background: url('https://assets.simpleviewinc.com/simpleview/image/upload/c_fill,f_avif,h_1080,q_95,w_1920/v1/clients/milwaukee/VM_Hilton_Plaza_Suite_King_Room_9b5d673a-95c6-445e-ad6b-5ae85e260f18.jpg') no-repeat center center/cover;
      height: 70vh; /* Increased height */
      min-height: 500px;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      color: white;
      text-align: center;
      position: relative; /* This is crucial for positioning child elements */
    }
    
    .hero-section::before {
      content: '';
      position: absolute;
      inset: 0;
      background: rgba(0, 0, 0, 0.35); /* Dark overlay for text contrast */
      z-index: 1;
    }
    
    .hero-content {
      position: relative;
      z-index: 2;
      padding-bottom: 80px; /* Add padding to lift text above the search bar */
    }

    .hero-section h2 {
      font-size: 52px;
      font-weight: bold;
      margin-bottom: 10px;
      text-shadow: 2px 2px 8px rgba(0,0,0,0.6);
    }

    .hero-section p {
      font-size: 20px;
      text-shadow: 1px 1px 4px rgba(0,0,0,0.6);
    }

    /* This wrapper is now positioned absolutely at the bottom of the hero section */
    .search-bar-wrapper {
        position: absolute;
        bottom: 0; /* Align to the bottom of the hero section */
        left: 50%;
        transform: translate(-50%, 50%); /* Center horizontally and push down by half its height */
        width: 80%;
        max-width: 950px;
        z-index: 10;
    }

    .search-bar {
      background: white;
      padding: 15px;
      border-radius: 8px;
      display: flex;
      gap: 10px;
      align-items: center;
      box-shadow: 0 4px 20px rgba(0,0,0,0.2);
    }

    .search-bar > * {
        flex: 1 1 auto;
    }
    
    .search-bar select,
    .search-bar input,
    .search-bar button {
      padding: 12px;
      border: 1px solid #ccc;
      border-radius: 5px;
      font-size: 1rem;
      height: 50px;
    }

    .search-bar button {
      background: #0071c2;
      color: white;
      font-weight: bold;
      cursor: pointer;
      border: none;
      flex-grow: 0.5;
    }
    
    .search-bar button:hover {
        background: #005a9b;
    }

    .date-input::placeholder { color: #757575; }

    /* Add space above the city cards to prevent overlap with search bar */
    .places-section {
      display: grid;
      grid-template-columns: repeat(3, 1fr); 
      gap: 25px;
      padding: 40px;
      max-width: 1400px;
      margin: 80px auto 40px; /* Increased top margin */
    }

    .place {
      border-radius: 12px;
      overflow: hidden;
      box-shadow: 0 4px 8px rgba(0,0,0,0.1);
      transition: transform 0.3s ease, box-shadow 0.3s ease;
      cursor: pointer;
      display: flex;
      flex-direction: column;
    }

    .place:hover {
      transform: translateY(-5px);
      box-shadow: 0 8px 16px rgba(0,0,0,0.15);
    }

    .place img {
      width: 100%;
      height: 220px;
      object-fit: cover;
    }

    /* Responsive adjustments */
    @media (max-width: 900px) {
      .places-section {
        grid-template-columns: 1fr 1fr;
      }
    }
    @media (max-width: 600px) {
      .places-section {
        grid-template-columns: 1fr;
        padding: 20px;
        margin-top: 120px; /* More space on mobile */
      }
      .search-bar {
        flex-direction: column;
      }
    }
  `;

  return (
    <>
      <style>{pageStyles}</style>
      <div className="home-container">
        {/* The header is removed from this component to match the screenshot */}
        <main>
          <section className="hero-section">
            <div className="hero-content">
              <h2>Welcome to our website</h2>
              <p>Enter your dates to see the best prices and hotel deals</p>
            </div>
            <div className="search-bar-wrapper">
              <div className="search-bar">
                <select value={city} onChange={(e) => setCity(e.target.value)}>
                  <option value="">Where to go?</option>
                  <option value="Hyderabad">Hyderabad</option>
                  <option value="Vijayawada">Vijayawada</option>
                  <option value="Vizag">Vizag</option>
                </select>
                <input
                    className="date-input"
                    type="text"
                    placeholder="mm/dd/yyyy"
                    onFocus={(e) => (e.target.type = 'date')}
                    onBlur={(e) => (e.target.type = 'text')}
                />
                <input
                    className="date-input"
                    type="text"
                    placeholder="mm/dd/yyyy"
                    onFocus={(e) => (e.target.type = 'date')}
                    onBlur={(e) => (e.target.type = 'text')}
                />
                <button onClick={handleSearchClick}>Search</button>
              </div>
            </div>
          </section>

          <section className="places-section">
            <div className="place" onClick={() => handlePlaceClick('Hyderabad')}>
              <img src="https://wallpaperaccess.com/full/2142440.jpg" alt="Hyderabad" />
            </div>
            <div className="place" onClick={() => handlePlaceClick('Vijayawada')}>
              <img src="https://wallpaperaccess.com/full/1992125.jpg" alt="Vijayawada" />
            </div>
            <div className="place" onClick={() => handlePlaceClick('Vizag')}>
              <img src="https://dynamic-media-cdn.tripadvisor.com/media/photo-o/02/5f/6d/80/exterior-view.jpg?w=700&h=-1&s=1" alt="Visakhapatnam (Vizag)" />
            </div>
          </section>
        </main>
      </div>
    </>
  );
}
